import {ProfileContent} from "./components/profileContentComponents/ProfileContent";

function App() {
    return (
        <div className="app-wrapper">
            <Header/>
            <NavBar/>
            <div className="app-wrapper-content">
                <ProfileContent/>
                {/*<Dialogs/>*/}
            </div>

        </div>
    );
}


export default App;
